function VideoBackground() {
  return (
    <div>
        <iframe 
            width="560" 
            height="315" 
            src="https://www.youtube.com/embed/ZrpEIw8IWwk?si=PTk3WaExjfvSgt8i" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
    </div>
  )
}

export default VideoBackground
